import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import turkeyistanbul from '../../assets/images/turkeyistanbul.png'
import bgimage from '../../assets/images/25.jpg'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'

const MainWrapper = styled.div`
  padding : 24px 0px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  height: auto;
  @media (max-width: 990px) {
  flex-direction: column;
  align-items: center;
}
`
const SubWrapper1 = styled.div`
  width: 50%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
  @media (max-width: 990px) {
  padding-bottom: 24px;
  width: 70%;
}
`
const SubWrapper2 = styled.div`
  width: 25%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
  @media (max-width: 990px) {
  width: 70%;
  height: 784px;
}
`
const Subw1In1 = styled.div`
  width: 100%;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: row;
  padding: 0px 12px;
`
const Subw1In2 = styled.div`
  border : 1px solid rgba(0, 40, 100, 0.12);
  width: inherit;
  height: inherit;
  background-color : ${properties.white};
  display: flex;
  flex-direction: column;
`
const Timeline = styled.div`
  border-bottom : 1px solid rgba(0, 40, 100, 0.12);
  height: 56px;
  padding-left: 24px;
  display: flex;
  flex-direction: row;
  align-items: center;
`
const SocialMedia = styled.div`
  height: 100%;
  padding: 8px 24px;
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0px 12px;
`
const FbT = styled.div`
  width: 50%;
  height: 784px;
  background-color : ${properties.messagesBlackTime};
  display: flex;
  flex-direction: row;
  align-items: center;
  padding: 0px 12px;
`
const VenueImage = styled.div`
  background-image: url(${props => props.turkeyistanbul});
  background-size: cover;
  height: 240px;
  cursor: pointer;
`
const VenueText = styled.div`
  height: 330px;
  background-color: red;
  padding: 24px;
  display: flex;
  flex-direction: column;
  align-items: center;
`
const VenueHead = styled.div`

`
const VenueTimeLocation = styled.div`

`


class Home extends Component {
  render() {
    return (<div>
      <Header />
      <HeaderDown />
      <MainWrapper >
        <SubWrapper1>
          <Subw1In1>
            <Subw1In2>
              <Timeline>
                <TextBox
                  // paddingLeft={"10px"}
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}
                >
                  Timeline
                    </TextBox>
              </Timeline>
              <SocialMedia>
                <FbT>

                </FbT>
                <FbT>

                </FbT>
              </SocialMedia>
            </Subw1In2>
          </Subw1In1>

        </SubWrapper1>
        <SubWrapper2>
          <Subw1In1>
            <Subw1In2>
              <Timeline>
                <TextBox
                  color={properties.littleLightGrey}
                  fontSize={fSize.slarge}
                >
                  Venue
                    </TextBox>
              </Timeline>
              <VenueImage turkeyistanbul={turkeyistanbul} />
              <VenueText>
                <VenueHead>
                  <TextBox
                    color={properties.littleLightGrey}
                    fontSize={fSize.slarge}
                  >
                    Venue Head
                    </TextBox>
                </VenueHead>
                <VenueTimeLocation>
                  <TextBox
                    color={properties.littleLightGrey}
                    fontSize={fSize.slarge}
                  >
                    Venue Head
                    </TextBox>
                </VenueTimeLocation>
              </VenueText>
            </Subw1In2>
          </Subw1In1>
        </SubWrapper2>
      </MainWrapper>

      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Home
